import React, {useRef} from "react";
import {useGLTF} from "@react-three/drei";
import {useFrame} from "@react-three/fiber";

export function Model(props) {
    const {nodes, materials} = useGLTF("/old-monitor.gltf");
    const group = useRef()
    useFrame(state => {group.current.rotation.y = (Math.sin(state.clock.elapsedTime))})

    return (
        <group ref={group} {...props} dispose={null} position={[0, -1, 0]}>
            <mesh
                geometry={nodes.Cube_BakedPCBody_0.geometry}
                material={materials.BakedPCBody}
                position={[0, 0, 0]}
                rotation={[-Math.PI / 2, 0, 0]}
                scale={1.9}
            />
            <mesh
                geometry={nodes.Cube_BakedScreen_0.geometry}
                material={materials.BakedScreen}
                position={[0, -1.71, 0]}
                rotation={[-Math.PI / 2, 0, 0]}
                scale={1.94}
            />
        </group>
    );
}

useGLTF.preload("/old-monitor.gltf");
